import  Navbar  from "../../Componentes/Navbar";
import Paragrafos from "../../Componentes/Paragrafos";
import Infoprojetos from "../../Componentes/InfoProjetos";
import Rodape from "../../Componentes/Rodape";
function Home () {
  return (
<> 

   <Navbar/>
  <body>

  <div id="paragrafo">
    <h1>odos os projetos integrados das ETE's Conectados em um só Lugar</h1>
    <p>O Repositório conect ETE PE é uma base de dados online que objetiva reunir, de forma organizada e acessível, a produção científica e documental das ETE'S de toda RMR
  com o intuito de torná-la acessível aos pesquisadores e ao grande público nacional e internacional.</p>
  </div>

  </body>
</>

  );
}

export default Home;
